#Charity is #vital, as it enables us to reach out to wider parts of #society, assisting those who need our help the most. This is why the International Day of Charity is so important. It raises #awareness about charity and why it is important to help those who are in need.
#InternationalDayofCharity serves to increase and enhance social responsibility across the entire world, increasing our support for #charitable causes and bringing everyone together in solidarity. This day presents you with a great #opportunity to get involved in the charity events that are going on around the world. 
As we will explain more in the next section, the #UnitedNations created this date, and so they have a very big role to play when it comes to the charitable efforts that are going on around the world, especially on this date. The #UN invites all member states, as well as various companies and #organizations and individuals to celebrate this date by doing anything they can to contribute their charity efforts. The UN encourages activities that raise #awareness, driving #education, and charity donations in a way of pushing just how critical #charity is.
To honour the important work that these many charities do, in #2012 the United Nations decided to nominate an annual International Day of Charity as an official day of recognition and celebration. The reason the date was chosen is because it is the #anniversary of the #death of #MotherTeresa of Calcutta.
This choice #commemorates the #tireless work that Mother Teresa did by devoting her whole life to #charity #work. To celebrate this special day every year, the work of different #charities all over the word is publicised and celebrated, and people are encouraged to donate money and time, to carry out charitable works, and also to educate people and raise awareness about the many charitable issues worldwide. #Education and giving are the essence of this special day.
